        const  {id,title,image,price,category} = product 
    })
 
    return (
        <div className='four column wide' style={{marginTop:'50px'}}>
             <div className='ui link cards'>
                <div className='card'>
                    <div className='image'>
                        <img src={image} alt="" />
                    </div>
                    <div className='content'>
                        <div className='header'>{title}</div>
                    </div>
                </div>
             </div>
        </div>
    );
};

